import React from 'react';
import "./Article.css";
import BigClap from "./../../images/clap@2x.png";
import BigShare from "./../../images/share@2x.png";
import SmallClap from "./../../images/clap.png";
import SmallShare from "./../../images/share.png";

function Article() {
    return (
        <div>
            <div className="clap-share-article">
                <div className="clap-share">
                    <div style={{"margin":"auto"}}>
                        <div className="clap">
                            <span><img src={BigClap} alt="" /></span>
                            <span>9.3k</span>
                        </div>
                        <div className="share">
                            <span><img src={BigShare} alt="" /></span>
                            <span>Share this article</span>
                        </div>
                    </div>
                </div>
                <div className="article"></div>
            </div>
            <div className="load-more"></div>
        </div>
    )
}

export default Article;
